"use client";

import React from "react";
import html2pdf from "html2pdf.js";
import "./invoice-pdf.css"
import { formatAmount } from "@/lib/common";

const InvoicePdf = ({ invoice }) => {

  const save = () => {
    let element = document.getElementById("element-to-print");
    let opt = {
      filename: "myfile.pdf",
      image: { type: "jpeg", quality: 1.0 },
      html2canvas: { scale: 2 },
      jsPDF: { unit: "in", orientation: "portrait" },
    };
    html2pdf(element, opt);
  };
  return (
    <>
      <div id="element-to-print" style={{ border: "1px solid #707070", padding: "24px", borderRadius: "5px", backgroundColor: "#192229", color: "white", margin: "24px" }}>
        <div style={{ marginBottom: "24px" }}>

          <img src="data:image/png;base64," style={{ height: "72px", width: "72px", borderRadius: "5px", border: "1px solid #707070" }} />



        </div>

        <table style={{ width: "100%", borderCollapse: "collapse", border: "1px solid #707070", borderRadius: "5px" }}>
          <thead >
            <tr style={{ backgroundColor: "#313238", color: "#cecece", borderRadius: "5px 5px 0px 0px", fontWeight: 400, margin: 0, display: "flex" }}>
              <th className="table-header-item index">#</th>
              <th className="table-header-item item-name">Item</th>
              <th className="table-header-item item">Quantity</th>
              <th className="table-header-item item">Unit Price</th>
              <th className="table-header-item item">Total</th>
            </tr>
          </thead>
          <tbody >{
            invoice.items.map((i, index) => (<tr key={i.id} style={{ color: "#fff", fontWeight: 400, margin: 0, display: "flex", borderTop: "1px solid #707070" }}>
              <td className="table-item index">{index + 1}</td>
              <td className="table-item item-name">{i.name}</td>
              <td className="table-item item">{i.quantity}</td>
              <td className="table-item item">{formatAmount(i.price)}</td>
              <td className="table-item item">{formatAmount(i.price * i.quantity)}</td>
            </tr>))}
          </tbody>
        </table>

      </div >



      <button
        onClick={() => {
          save();
        }}
      >
        Save
      </button>
    </>
  );
};

export default InvoicePdf;
